import React from 'react';
import '../App.css';
import '../fontawesome/css/all.css';
import Header from './Header';
import CardList from './Card';
import { navigate,Router } from '@reach/router';
import Add from './Add'
import { FaRup, FaRupeeSigneeFaRupeeSign } from 'react-icons/fa'

function Cardlist(props){
    return(
        <div> 
        <Header />
        <div className="container" style={{marginTop:"66px"}}>
         <CardList />
        </div>
        <div className="fixed-bottom d-flex justify-content-center">
            <div className="badge bg-warning d-flex align-items-center justify-content-center text-light" onClick={data} style={{height:"40px",fontSize:"16px"}}><FaRupeeSign /> SELL</div>
        </div>
        </div>
    );
}

function data(){
    navigate('register')
   }

class App extends React.Component {
    constructor(props){
        super(props)
        this.state={
            users:null,
        }
    }

   render(){
    return(
        <Router>
        <Cardlist path="/" />
        <Add path="/register" />
        </Router>
       );
   }
}


export default App;
